PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "tracks" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime, "updated_at" datetime, "circuitId" varchar(255), "lat" decimal(10,6), "long" decimal(10,6), "country" varchar(255), "locality" varchar(255), "circuitName" varchar(255));
COMMIT;
